import * as request from "../utils/request";

export const get = async (path) => {
  try {
    const res = await request.get(path);
    return res.data;
  } catch (error) {
    console.log(error);
  }
};

export const post = async (path, value) => {
  try {
    const res = await request
      .post("brand/save", value)
      return res;
  }
  catch(error) {
    console.log(error);
  }
}
